pragma solidity >=0.4.21 <0.6.0;

import './Person.sol';

contract Doctor is Person {
  address[] private patients;

  constructor(address _owner, address _interactionContractAddress) public Person(_owner, _interactionContractAddress) {
  }

  function addPatient(address _patient) public onlyOwner {
    patients.push(_patient);
  }

  function getPatients() public onlyOwner view returns (address[] memory) {
    return patients;
  }
}
